import React,{Component} from 'react';
import './Frame .css'

class Frame extends Component{
    constructor (props) {
        super(props)
        this.state = {
          anh :'http://localhost:4000/anh/' + this.props.anh,
          anhhover:'http://localhost:4000/anh/'+this.props.to+"_to3"
        }
     }
    render(){
        // var {match}=this.props;
        // console.log(this.prop.to);
        var name=this.props.to;
        // console.log('http://localhost:4000/anh/'+this.state.to+"_to2");
        return(
            <div className="frame">
                <a href={`/${name}`}  >
                    <div class="container1">
                        <img className="img1" src={this.state.anh} alt="Avatar"></img>
                        <div class="overlay">
                        <img className="img1" src={this.state.anhhover}></img>
                        </div>
                    </div>
                    <p className="frame-p">{this.props.ten} </p>
                    <b>
                        <span className="frame-giacu"> {this.props.giacu+''}</span>
                        <span className="frame-giamoi"> {this.props.giamoi +""}</span>
                    </b>
                </a>
                
            </div>
        )
}}
export default Frame
